fn is_equal(a: i64, b: i64) -> bool {
    let mut result = true;
    let mut i = 0;
    while i < 64 {
        let bit_a = (a >> i) & 1;
        let bit_b = (b >> i) & 1;
        if bit_a != bit_b {
            result = false;
            break;
        }
        i += 1;
    }
    result
}

fn print_result(num: i64) {
    let mut is_even = false;
    let mut i = 0;
    while i < 64 {
        let bit = (num >> i) & 1;
        if i == 0 && bit == 0 {
            is_even = true;
            break;
        }
        i += 1;
    }
    if is_even {
        println!("Even");
    } else {
        println!("Odd");
    }
}
